import React from "react";
import Item from "./Items";

export default function List({ blocktext }) {
  return (
    <div>
      {blocktext.map((v) => (
        <div>
          <Item text={v.text} />
        </div>
      ))}
      <button class="end">+ Add a card</button>
    </div>
  );
}
